import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const UploadEventScreen = () => {
  return (
    <View>
      <Text>UploadEventScreen</Text>
    </View>
  )
}

export default UploadEventScreen

const styles = StyleSheet.create({})
